import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return props.data.map((prop) => (
    <div key={prop.id} className="expenses">
      <ExpenseItem title={prop.title} amount={prop.amount} date={prop.date} />
    </div>
  ));
}

export default Expenses;
